export default function ExpenseDate(props) {
	const month = props.date.toLocaleString("pt-BR", { month: "long" });
	const day = props.date.toLocaleString("pt-BR", { day: "2-digit" });
	const year = props.date.getFullYear();

	return (
		<div>
			<div>{month}</div>
			<div>{day}</div>
			<div>{year}</div>
		</div>
	);
}
